  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<TicketForm />} />
          <Route path="/admin" element={<Admin />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
